import React from 'react';
import {connect} from 'react-redux';
import { createStructuredSelector } from 'reselect';

import {selectclickedtshirt} from '../../redux/shop/shop.selector';
import {selectTshirtsFromShop} from '../../redux/shop/shop.selector'

const Itempage =({match, selecteditem})=>{
    console.log('itempage being called')
    return(
    <div>
        <h1>{match.params.name}</h1>
        {selecteditem.title}
    </div>
)}

const mapStateToProps = createStructuredSelector({
    tshirts:selectTshirtsFromShop,
    selecteditem:selectclickedtshirt
})

export default connect(mapStateToProps)(Itempage);
